cac:SubordinateAwardingCriterion.cbc:Description:
Punctajul se acorda astfel:
a) pentru livrari directe (ofertantul este producatorul original), se acorda punctaj maxim - 30 puncte ;
b) pentru livrari cu un singur operator economic implicat in lantul de aprovizionare (intermediar) - 20 puncte ;
c) pentru doi operatori economici implicati in lantul de aprovizionare - 10 puncte ;
d) pentru mai mult de doi operatori economici - 0 puncte .
Nota: Pentru a obtine punctajul corespunzator, operatorii economici trebuie sa prezinte in cadrul ofertei documente care confirma livrarea directa de la producator sau implicarea unui singur operator economic in lantul de aprovizionare.

